import React from 'react';

const FeedbackCard = ({ feedback }) => (
  <div className="bg-brand.light p-3 rounded shadow mb-2">
    <p className="text-brand.heading font-bold">{feedback.customerName}</p>
    <p className="text-brand.body">{feedback.message}</p>
    <p className="text-brand.body text-sm">Status: {feedback.status}</p>
  </div>
);

export default FeedbackCard;
